INSERT INTO `dialog_text` (`id`, `inhalt`, `kategorie_id`) VALUES
	(1, '(zurück)', 1),
	(2, '(Dialog beenden)', 1),
	(3, 'Sei gegrüßt, junger Drachling.\r\nWie kann ich dir helfen?', 2),
	(4, 'Oh gut dass du fragst. Du kannst mir nicht zufällig 5 Äpfel besorgen? Wynora kommt heute zu Besuch. Ein Apfelkuchen wäre da genau das richtige, um ihren Augen wieder ein Leuchten zu entlocken.', 3),
	(5, 'Schade, na dann vielleicht ein andermal. Dann müssen eben doch die Birnen dran glauben.', 3),
	(6, 'Vielen Dank Drachling. Da wird Wynora aber Augen machen.', 3),
	(7, 'Hast du eine Aufgabe für mich?', 3),
	(8, 'Kannst du mir einige Dinge verkaufen?', 4),
	(9, 'Wie wäre es mit einem Übungskampf?', 5),
	(10, 'Na klar. Kein Problem. Ist so gut wie erledigt.', 3),
	(11, 'Dafür habe ich gerade leider keine Zeit', 3),
	(12, 'Hier sind deine Äpfel, die du wolltest.', 3),
	(13, 'Perfekt! Ich freue mich auf deine Rückkehr.', 3),
	(14, 'Bist du dir sicher? Ich werde nicht zimperlich sein. Wir kämpfen bis einer von uns am Boden liegt.', 5),
	(15, 'Ja', 1),
	(16, 'Nein', 1);
