INSERT INTO `gebiet` (`id`, `bilder_id`, `titel`, `beschreibung`, `titel_intern`) VALUES
	(1, 2, 'Ormanko', 'Nass, schmutzig und schauerlich. Ein Sumpf eben!', 'Sumpf'),
	(2, 3, 'Rapano', 'Das feurige Herz von Gaia. Vorsicht heiß!', 'Vulkan'),
	(3, 4, 'Irakon', 'Ein schöner großer See lädt euch zum Baden gehen ein. An die Hacke, fertig, los!', 'Eissee'),
	(4, 5, 'Karmana', 'Gestrüpp soweit das Auge reicht. Was hier alles kreucht und fleucht, wollt ihr euch gar nicht erst ausmalen.', 'Dschungel'),
	(5, 6, 'Rastagy', 'Ihr schaut in den Abgrund und sogleich juckt es euch in den Flügeln. Traut euch!', 'Klippe'),
	(6, 7, 'Koban', 'Funkelnde Steine weit und breit. Ein wahres Paradies ... wenn man es kalt, muffig und feucht mag.', 'Kristallhöhle'),
	(7, 8, 'Aktor', 'Naaaa, wollt ihr etwas zu trinken? Hier ganz sicher nicht!', 'Wüste'),
	(8, 9, 'Everleen', 'Ein mächtiger Stamm, gewaltiges Blattwerk und die schier endlose Höhe lassen auf einen Mammutbaum schließen.', 'Mammutbaum'),
	(9, 10, 'Aurales', 'Manchereins sieht den Wald vor lauter Bäumen nicht. Hinweis: Ihr steht gerade in einem!', 'Wald'),
	(10, 11, 'Tongaris', 'Träumt ihr oder halluziniert ihr nur? Wasser und Grün mitten in der Wüste. Das kann doch nicht mit rechten Dingen zugehen.', 'Oase'),
	(11, 12, 'Aportemis', 'Gras überall Gras. Ihr schlagt die Hände über dem Kopf zusammen und denkt: \'Wenn man es wenigstens rauchen könnte ...\'', 'Steppe'),
	(12, 1, '---ohne---', '---ohne---', '---ohne---');
